import React from "react";
import EmojiObjectsIcon from '@material-ui/icons/EmojiObjects';

function Header() {
    return(
        <header >
            <h1><EmojiObjectsIcon fontSize="large"></EmojiObjectsIcon>Keeper</h1>
        </header>
    );
}

export default Header;
